import React, { Component } from "react";
import "./MailsDefault.css";

class Mail28 extends Component {
  state = {};
  render() {
    return (
      <div>
        <div>
          <div>
            <p
              className="MsoNormal"
              style={{ textAlign: "center", lineHeight: ".75pt" }}
              align="center"
            >
              <span style={{ fontSize: "1.0pt", display: "none" }}>
                Mehr Speicher erhalten | Der Speicherplatz Ihres privaten Kontos
                ist nahezu ausgeschöpft. Wenn Sie OneDrive weiterhin nutzen
                möchten, können Sie ein Upgrade für Ihr Konto durchführen oder
                nicht benötigte Dateien entfernen.
              </span>
              <span
                style={{ fontSize: "1.0pt", color: "black", display: "none" }}
              />
              <span style={{ fontSize: "1.0pt", display: "none" }}>
                <u />
                <u />
              </span>
            </p>
          </div>
          <div align="center">
            <table
              style={{
                width: "495.0pt",
                borderCollapse: "collapse",
                minWidth: "660px",
              }}
              width={660}
              cellSpacing={0}
              cellPadding={0}
              border={0}
            >
              <tbody>
                <tr>
                  <td style={{ padding: "0cm 0cm 0cm 0cm" }} valign="top">
                    <table
                      style={{ width: "100.0%", borderCollapse: "collapse" }}
                      width="100%"
                      cellSpacing={0}
                      cellPadding={0}
                      border={0}
                    >
                      <tbody>
                        <tr>
                          <td
                            style={{
                              background: "white",
                              padding: "0cm 0cm 0cm 0cm",
                            }}
                          >
                            <table
                              style={{
                                width: "100.0%",
                                borderCollapse: "collapse",
                              }}
                              width="100%"
                              cellSpacing={0}
                              cellPadding={0}
                              border={0}
                            >
                              <tbody>
                                <tr>
                                  <td
                                    style={{
                                      background: "white",
                                      padding: "7.5pt 37.5pt 0cm 37.5pt",
                                    }}
                                  >
                                    <p
                                      style={{
                                        textAlign: "center",
                                        lineHeight: "10.5pt",
                                      }}
                                      align="center"
                                    >
                                      <span
                                        style={{
                                          fontSize: "7.5pt",
                                          fontFamily: '"Segoe UI",sans-serif',
                                          color: "#737373",
                                          letterSpacing: "-.1pt",
                                        }}
                                      >
                                        <a
                                          href="https://click.mail.onedrive.com/?qs=ef32d819733cb175c5eaf6c006d9bc86e501cb4c8d4aaede4c805ba52335b903aeb6bd2188219688c97fcd09c49c469431028c140924451615cba18e4bf97802"
                                          target="_blank"
                                          data-saferedirecturl="https://www.google.com/url?hl=de&q=https://click.mail.onedrive.com/?qs%3Def32d819733cb175c5eaf6c006d9bc86e501cb4c8d4aaede4c805ba52335b903aeb6bd2188219688c97fcd09c49c469431028c140924451615cba18e4bf97802&source=gmail&ust=1597142075947000&usg=AFQjCNGRf_aOx8Tyaz1OfKGT41_YaYZ4Pg"
                                          onMouseEnter={() => {
                                            this.props.insideEmailInfo(
                                              true,
                                              "InLink1"
                                            );
                                          }}
                                          onMouseLeave={() => {
                                            this.props.insideEmailInfo(
                                              false,
                                              "InLink1"
                                            );
                                          }}
                                          onMouseOver={() => {
                                            this.props.insideEmailInfo(
                                              true,
                                              "InLink1"
                                            );
                                          }}
                                          onClick={() => {
                                            this.props.insideEmailInfo(
                                              true,
                                              "ClickedLink1"
                                            );
                                          }}
                                        >
                                          <strong>
                                            <span
                                              style={{
                                                fontFamily:
